import React from 'react';
import './App.css';

class App extends React.Component {

  constructor(props){
    super(props);
    this.state = {
      title: 'Jamil Naber',
      headerLinks : [
        {title: 'Home', path: '/' },
        {title: 'About', path: '/about' },
        {title: 'Contact', path: '/contact' }
      ],
      home: {
        title: 'Welcome ',
        subTitle: 'Summarization of my life',
        text: 'Take a look at my projects' 
      },
      about: {
        title: 'About me '
      },
      contact: {
        title: 'Message Me'
      }
    }
  }

  render(){
    return (
        <div>Hello from React</div>
      );
  }
}

export default App;
